import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';

import UploadUser from './uploadUser';
import EmployeeDashboard from './employeeDashboard';
import EmployeeCRUD from './employeeCRUD';
import EmployeeAbout from './employeeAbout';

function App() {
  return (
    <div className="App">
      <ul className="headerMenuContainer">
        <li><a href="/upload">Upload Users</a></li>
        <li><a href="/dashboard">Employee Dashboard</a></li>
        <li><a href="/crud">CRUD Feature</a></li>
        <li className="floatRight"><a className="active" href="">HR Management Portal</a></li>
      </ul>

      <BrowserRouter>
        <Switch>
          <Route path="/upload">
            <UploadUser />
          </Route>
          <Route path="/dashboard">
            <EmployeeDashboard />
          </Route>
          <Route path="/crud">
            <EmployeeCRUD />
          </Route>
          <Route path="">
            <EmployeeAbout />
          </Route>
        </Switch>
      </BrowserRouter>

    </div>
  );
}

export default App;
